import React from "react";
const ToDoList = (state)=>
{
  const{items} = state;
  DeleteItem=(id)=>{
    let items = this.state.items.filter(item=>{
      return item.id !== id
    })
    this.setState({
      items
      })
  }



        
                    const nam = items.map(item=>{


return (
  <div key={item.id}>
     {item.name}
{item.age}
items.map(item=>{
  <div key={item.id}>
      <span onClick={()=>DeleteItem(item.id)}>DeleteBtn</span>

  </div>
})
  </div>
)
  } )
        
return (
  <div>{nam}</div>
)
   
}

      export default ToDoList;
